const Header = (darkMode, setDarkmode) => {
    return (
        <header className='header'>
            <div className='header__container'>
                <h1 className='header__title'>Where in the world ? </h1>
                <button>
                    {darkMode ? 'Dark Mode' : 'Light Mode'}
                </button>
            </div>
        </header>
    )
}

export default Header;
